webpackJsonp([98253788769562],{558:function(n,t){n.exports={data:{site:{siteMetadata:{title:"MyBlog"}},markdownRemark:{html:'<pre><code class="language-c">#include &#x3C;stdio.h>\n#include &#x3C;stdlib.h>\n\ntypedef struct Node {\n    Node *next;\n    int data;\n}\n\nint search(Node *list, int x) {\n    Node *ptr;\n    ptr = list;\n    while(ptr) {\n        if(pt->data == x) return 1; // Number found\n        ptr = ptr->Next;\n    }\n    return 0; // Number not found\n}\n\nint main() {\n    uint8_t result;\n    Node linkedList[3] = {\n        {&#x26;LinkedList[1], 1},\n        {&#x26;LinkedList[2], 10},\n        {NULL, 100}\n    };\n    result = search(linkedList, 9); // LinkedList = &#x26;LinkedList[0]\n    if(result) printf("Number found!\\n");\n    else printf("Number not found!\\n");\n    return 0;\n}\n</code></pre>',frontmatter:{title:"Linked lists in C",author:"Maximiliano Valencia",date:"21 March, 2018"}}},pathContext:{slug:"/posts/linked_lists_in_c/"}}}});
